import React, { useState } from 'react'
import "./Home.css"
import image_2 from "../uploaded.jpg";
import image_3 from "../enhanced.jpg"
import triple_clicked from "../triple_clicked.png"

const Home = () => {

    const [isOpen, setIsOpen] = useState(false);

    const handleButtonClick = () => {
      setIsOpen(!isOpen);
    };

return (
    <div className = "home_main_div">
      <div className = "spinning_border"></div>
      <div className = "spinning_border_2"></div>
      <div className = "home_head">
      <h1 className = "home_welcome">Welcome to</h1>
      <h1 className = "home_enhance">Enhance AI</h1>
      <h3 className = "home_exp">A platform to help you enhance your images <br/> using the power of AI.</h3>
      </div>
      <img src = {image_2} className = "uploaded" alt = "uploaded_image"/>
      <img src = {image_3} className = "enhanced" alt = "enhanced_image"/>
      <button className = "login_menu_button" onClick={handleButtonClick}><img className = "login_img_clicked" src = {triple_clicked} alt = "menu-buttonss"></img></button>
      {isOpen && (<div className = "login_menu">
        <button className = "login_menu_button_clicked" onClick={handleButtonClick}><img className = "login_img_clicked" src = {triple_clicked} alt = "menu-buttonss"></img></button>
          <div className = "login_info">
          <button className = "login_home"><a className = "login_home" href = "/login">Login</a></button>
          <button className = "login_instr"><a className = "login_home" href = "/signup">Sign Up</a></button>
          </div>
      </div>)}
    </div>
  )
}

export default Home
